import React from "react";

function Navbar(){
    return (
        <div className="navbar">
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/about">About</a></li>
                <li><a href="/skills">Skills</a></li>
                <li><a href="/contact">Contactme</a></li>
            </ul>
        </div>
    )
}

export default Navbar;
